import React from 'react';
console.log("tôi là setting");
function Setting() {
    const Setting = () => {
        return (
            <>
                <h1>Tôi là setting</h1>
            </>
        )
    }

    return (
        <Switch>
            <Route component={Setting} />
        </Switch>
    )



}

export default Setting;
